// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

import "./StrawberryColorPaletteFactory.sol";

contract StrawberryDonorFactory is StrawberryColorPaletteFactory {
    struct StrawberryDonor {
        string name;
        uint paletteId;
    }

    StrawberryDonor[] donors;
    mapping (uint => address) donorToAddress;

    event DonorCreated(uint, string);

    function _createDonor(string memory _name) internal {
        donors.push(StrawberryDonor(_name, getRandomPalletIndex()));
        uint id = donors.length - 1;

        donorToAddress[id] = msg.sender;
        emit DonorCreated(id, _name);
    }
}

