// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract StrawberryColorPaletteFactory {
    struct Color {
        uint r;
        uint g;
        uint b;
    }

    struct ColorPalette {
        Color[] colors;
    }

    uint colorAmountPerPallet = 5;
    uint paletteAmount = 3;
    uint randNonce = 0;

    ColorPalette[] colorPalettes;

    constructor() {
    }

    function getRandomPalletIndex() internal returns(uint) {
        return random(paletteAmount);
    }

    function random(uint number) internal returns(uint) {
        randNonce++;
        return uint(keccak256(abi.encodePacked(block.timestamp, block.difficulty, msg.sender, randNonce))) % number;
    }
}

